import React from "react";

function Projects() {
  return (
    <div>
      <h1>Projects</h1>
      <div>
        <h2>SEAQIS Task Tracker</h2>
        <p>
          SEAQIS Task Tracker adalah aplikasi manajemen tugas berbasis web yang 
          dikembangkan untuk mendukung aktivitas kerja karyawan SEAQIS.
        </p>
        <a href="https://github.com/SEAQIS">Lihat di Github</a>
      </div>
      {/* Tambahkan proyek lainnya sesuai kebutuhan */}
    </div>
  );
}

export default Projects;
